def transform(sequence):
    sequence = list(sequence)
    mid_value = str(sum([int(x) for x in sequence]) // len(sequence))
    for i in range(len(sequence)):
        if sequence[i] != '0' and sequence[i] != mid_value:
            sequence[i] = '0'
    return ''.join(sequence)
